    void testBuildSuffixSumMap() {
        Solution soln = Solution();
        unordered_map<int, vector<int> > valueIndicesMap;
        unordered_map<int, vector<long long> > suffixSumMapOutExpected, suffixSumMapOutComputed;

        valueIndicesMap = {
                {1, {0, 2, 3}},
                {2, {4}},
                {3, {1}}
        };
        suffixSumMapOutExpected = {
                {1, {5, 5, 3}},
                {2, {4}},
                {3, {1}}
        };
        suffixSumMapOutComputed = soln.buildSuffixSumMap(valueIndicesMap);
        assert(suffixSumMapOutComputed == suffixSumMapOutExpected);

        valueIndicesMap = {
                {1, {1, 3}},
                {2, {0, 4}},
                {3, {2, 5, 6}}
        };
        suffixSumMapOutExpected = {
                {1, {4,  3}},
                {2, {4,  4}},
                {3, {13, 11, 6}}
        };
        suffixSumMapOutComputed = soln.buildSuffixSumMap(valueIndicesMap);
        assert(suffixSumMapOutComputed == suffixSumMapOutExpected);

        valueIndicesMap = {
                {5,  {1}},
                {10, {0, 2, 3}}
        };
        suffixSumMapOutExpected = {
                {5,  {1}},
                {10, {5, 5, 3}}
        };
        suffixSumMapOutComputed = soln.buildSuffixSumMap(valueIndicesMap);
        assert(suffixSumMapOutComputed == suffixSumMapOutExpected);

        printf("[testBuildSuffixSumMap] All test-cases passed\n");
    }

